INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('1', 'Italian Butter Cookies', 'Italian', 'These cookies are soft, flavorful and full of rich, buttery goodness. They are super easy and simple to make, you\'ll never buy them from a store or the bakery again.', '12.90');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('2', 'Canestrelli', 'Italian', 'Canestrelli are a wonderfully delicious Italian Cookie, an almost shortbread type cookie but with a crunch, fast and easy. The perfect afternoon tea cookie. A touch of Lemon makes them irresistible', '15.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('3', 'Tiramisu Ice Cream', 'Italian', 'Tiramisu Ice Cream - creamy, coffee flavored frozen dessert to enjoy on its own or add it on top of brownies, crepes or cookies.', '19.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('4', 'Caramel Flan', 'Mexican', 'A small slice of this impressively rich, creamy, caramel flan dessert goes a long way. What a delightful finish for a special meal or holiday celebration', '4.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('5', 'Sopapilla Cheesecake Bars', 'Mexican', 'Inspired by the popular Mexican pastry, Sopapilla Cheesecake Bars are a cinnamon sugar cheesecake dessert featuring a sweet cream cheese filling, crunchy-sweet topping and flaky crescent crust', '10.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('6', 'Pastel De Elote', 'Mexican', 'Sweet Corn Cake (Pastel De Elote) is a popular & delicious Mexican cake. Serve with cajeta, whipped cream, powder sugar, strawberries and vanilla ice cream.', '24.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('7', 'Gulab Jamun', 'Indian', 'Gulab jamun is a beloved Indian dessert consisting of fried balls of a dough made from milk solids and semolina, soaked with an aromatic syrup spiced with green cardamom, rose water, saffron, and more. Paying close attention to the ingredients and temper...', '29.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('8', 'Kaju Katli', 'Indian', 'Perfect Kaju Katli is a traditional Indian cashew fudge candy that\'s terrifically smooth, thin, and melts in your mouth. This lovely treat includes a hint of rose but is completely customizable with your favorite flavors.', '16.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('9', 'Indian Carrot Pudding', 'Indian', 'Gajar ka Halwa also known as Gajrela is an Indian Carrot Pudding that\'s prepared with ghee, carrots, milk, sugar, cardamom, and nuts. This is a Punjabi dessert that is widely popular in North India, especially during the winter months and Diwali season. ...', '14.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('10', 'Thai Coconut Ice Cream', 'Thai', 'A creamy, dairy free coconut ice cream recipe you can make at home, no ice cream maker required!', '9.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('11', 'Thai Coconut Mango Jelly', 'Thai', 'It\'s got everything you could ever ask for in a dessert, delicious, refreshing, beautiful, easy, and without even trying or needing to be modified, it\'s naturally healthy, vegan, and gluten-free', '15.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('12', 'Coconut Mango Tapioca Pudding', 'Thai', 'Chunky, fresh mango with tangy lime is a great counterpoint to the creamy tapioca pearl puddings here', '19.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('13', 'Whole Grain Citrus Muffin', 'Mediterranean', 'These Whole Grain Citrus and Olive Oil Muffins pair perfectly with a cup of coffee or tea. They are lightly sweetened and packed with good-for-you ingredients like spelt flour, orange juice, olive oil, and even carrots', '4.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('14', 'Honey Almond Ricotta Spread', 'Mediterranean', 'Spoon it over some hearty whole grain bread with some fruit for something a little different (and a bit indulgent) for breakfast. Or just grab a spoon and enjoy it simply on it\'s own or as a topping for some fruit.', '10.99');
INSERT INTO `heroku_c679880accdf827`.`dessert` (`dessertId`, `dessertName`, `cuisine`, `description`, `price`) VALUES ('15', 'Popped Quinoa Crunch Bar', 'Mediterranean', 'might be the coolest thing ever. Wrap your minds around this, people - you are eating a chocolate peanut butter swirl bar, but WAIT. It has a bunch of quinoa loaded up in there too.', '9.99');